import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    this.getWord();
  }

  getWord() {
    fetch("http://app.linkedin-reach.io/words", {
      mode: "no-cors",
      count: 10
    }).then(
      result => {
        // this.setState({
        //   isLoaded: true,
        //   items: result.items
        // });
        result.text().then(text => {
          console.log("ergerg");
          console.log(text);
        });
        //console.log(result.text().then());
      },
      error => {
        // this.setState({
        //   isLoaded: true,
        //   error
        // });
      }
    );
  }

  render() {
    return <p>Hey</p>;
  }
}

export default App;
